  \"2016-11-25T21:06:45.270972\",\n\t\"name\": \"teacher-follow-up-survey-2012-13\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The 2012-13 Teacher Follow-Up Survey (TFS
  12/13) is a longitudinal follow-up to the 2011-12 Schools and Staffing Survey (SASS
  11-12). TFS 12/13 (http://nces.ed.gov/surveys/sass/) determines how many teachers
  remained at the same school, moved to another school, or left the profession in
  the year following the Schools and Staffing Survey (SASS) administration. TFS 12/13
  was administered to a sample of teachers who completed the SASS in the previous
  year. The majority of TFS 12/13 is a web-based survey, but it also has paper component.
  Key statistics produced from TFS 12/13 are how many teachers remained at the same
  school, moved to another school, or left the profession in the year following the
  Schools and Staffing Survey (SASS) administration.\",\n\t\"license_title\": \"Creative
